import axios from 'axios';

const getCourseByIdService = (cid) => {
    console.log(`getCourse ById Service`);
    return axios.get(`/trainingcourse/${cid}`);
}

const getAllCourzeService = () => {
    console.log(`getEmpByIdService`);
    return axios.get(`/emp/getallemps`);
}



export { getCourseByIdService};
